import React from 'react';
import './Header.css';
import logo from '../assets/images/iskcon-logo.png';

const Header = () => {
  return (
    <header className="header">
      <div className="header-container">
        <div className="header-content">
          <div className="logo-container">
            <img src={logo} alt="ISKCON Logo" className="logo" />
            <div className="brand-text">
              <h1 className="brand-title">ISKCON Deoghar</h1>
              <p className="brand-subtitle">International Society for Krishna Consciousness</p>
            </div>
          </div>
        </div>
        <div className="decorative-element"></div>
      </div>
    </header>
  );
};

export default Header;
